  - '&fYou can make progress by &#a5fb4ft&#9af75br&#8ff368a&#84ef74d&#79eb81i&#6ee78dn&#63e39ag &#58dfa6t&#4ddbb2h&#42d7bfe &#37d3cbi&#2ccfd8t&#21cbe4e&#16c7f1m&#0bc3fds &fyou obtain from the mines with the villagers in the spawn.'
