  - '&fYou can &#8bfbfbw&#93edf9i&#9bdef7n &#a3d0f4a&#acc1f2m&#b4b3f0a&#bca4eez&#c496eci&#cc88e9n&#d479e7g &#dc6be5i&#e55ce3t&#ed4ee0e&#f53fdem&#fd31dcs &fby joining in different events held every day.'
  - '&fYou can use the &#f8fb6fl&#f9ea7cu&#f9d989c&#fac996k &#fab8a3b&#fba7b0l&#fb96bdo&#fc86cac&#fc75d7k&#fd64e4s &fyou have obtained from the mines by placing them in the lucky blocks area.'
